export function Contact() {

    return (
        <div>
            <h1>this is contact page</h1>
            <button><Link to="/b" ></Link> Back</button>
        </div>

    )
}



export function Notice() {
    return (
        <div>
            <h1>this is notice page</h1>
        </div>

    )
}
